early on to make a good save from a header, while the Pole delivered a simply remarkable stop to deny Stephan El Shaarawy at the death, but in between those moments the visitors often struggled to produce the sort of clear-cut openings that would have delivered the three points.\r\n\r\nAfter a smattering of chances in the opening 80 minutes it was in the final 10 that Luciano Spalletti\'s side really pushed forward, but the Empoli goal seemed to have something of a forcefield around it as headers were cleared off the line, snap-shots were blocked and goal-bound shots palmed away by Skorupski.\r\n\r\nThe result leaves Roma still second in the Serie A standings, albeit now four points behind leaders Juventus.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1201:\"<p>Roma were held to a frustrating 0-0 draw at the Stadio Carlo Castellani on Sunday, as a solid rearguard action from Empoli saw them claim a point.</p>\n<p>The Giallorossi\'s best chances of the game came at the very beginning and end of the 90 minutes - but Lukasz Skorupski proved more than equal to the challenge as he repelled everything Roma threw at him, securing a third successive clean sheet for himself and a point for his team.</p>\n<p>Edin Dzeko had Skorupski sprawling early on to make a good save from a header, while the Pole delivered a simply remarkable stop to deny Stephan El Shaarawy at the death, but in between those moments the visitors often struggled to produce the sort of clear-cut openings that would have delivered the three points.</p>\n<p>After a smattering of chances in the opening 80 minutes it was in the final 10 that Luciano Spalletti\'s side really pushed forward, but the Empoli goal seemed to have something of a forcefield around it as headers were cleared off the line, snap-shots were blocked and goal-bound shots palmed away by Skorupski.</p>\n<p>The result leaves Roma still second in the Serie A standings, albeit now four points behind leaders Juventus.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:17:\"field_reviewimage\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"42\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:25:\"t62kuykrxzhfogrnltcr.jpeg\";s:3:\"uri\";s:34:\"public://t62kuykrxzhfogrnltcr.jpeg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:6:\"289002\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1477904252\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"1918\";s:6:\"height\";s:4:\"1279\";}}}s:14:\"field_category\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:3:\"tid\";s:1:\"1\";}}}s:12:\"field_rating\";a:1:{s:3:\"und\";a:1:{i:0;a:2:{s:6:\"rating\";s:2:\"80\";s:6:\"target\";N;}}}}',0,1477905139,1),('field:node:25','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1345:\"Luciano Spalletti, the new Giallorossi manager, talks exclusively to asroma.com about what it means to return to the club he loves…\r\n\r\nWelcome back to Roma, Luciano…\r\n\r\n“Thanks. I\'ve never forgotten my time here and Roma has never left my heart.”\r\n\r\nCan you describe how you\'re feeling at the moment?\r\n\r\n“I\'m excited because I know what the merits of this city, this club and this team are. It\'s exciting to work with such worthy people.”\r\n\r\nDid you ever think this opportunity might come around for you again? \r\n\r\n“I\'ve seen things happen in football that I thought would never come to pass. I always had that hope because Rome is a fantastic place to be.”\r\n\r\nThere were lots of rumours about you possibly returning to Roma. When did you start to take them seriously?\r\n\r\n“When I got the phone call from Walter Sabatini.”\r\n\r\nHow did your meeting with James Pallotta go? What did you talk about most?\r\n\r\n“I found him to be a man of exceptional enthusiasm who, despite being physically distant, has the best interests of our team, our city and our club at heart. He clearly has plans for the future and I think that\'s the most important thing to say about our president. People often think that if you live far away, you see something like this as a pastime but Roma really matters to him. That\'s the most important thing.”\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1393:\"<p>Luciano Spalletti, the new Giallorossi manager, talks exclusively to asroma.com about what it means to return to the club he loves…</p>\n<p>Welcome back to Roma, Luciano…</p>\n<p>“Thanks. I\'ve never forgotten my time here and Roma has never left my heart.”</p>\n<p>Can you describe how you\'re feeling at the moment?</p>\n<p>“I\'m excited because I know what the merits of this city, this club and this team are. It\'s exciting to work with such worthy people.”</p>\n<p>Did you ever think this opportunity might come around for you again? </p>\n<p>“I\'ve seen things happen in football that I thought would never come to pass. I always had that hope because Rome is a fantastic place to be.”</p>\n<p>There were lots of rumours about you possibly returning to Roma. When did you start to take them seriously?</p>\n<p>“When I got the phone call from Walter Sabatini.”</p>\n<p>How did your meeting with James Pallotta go? What did you talk about most?</p>\n<p>“I found him to be a man of exceptional enthusiasm who, despite being physically distant, has the best interests of our team, our city and our club at heart. He clearly has plans for the future and I think that\'s the most important thing to say about our president. People often think that if you live far away, you see something like this as a pastime but Roma really matters to him. That\'s the most important thing.”</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:12:\"field_person\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:3:\"tid\";s:1:\"4\";}}}}',0,1477905152,1),('field:node:26','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1570:\"On his 40th birthday, Francesco Totti sat down to discuss the milestone - what he has done so far in his remarkable career, and what he still hopes to achieve.\r\n\r\nRead the full transcript from the interview below.\r\n\r\nYou scored your 250th Serie A goal against Torino on Sunday. You weren’t joking when you said you wanted to beat Silvio Piola’s record!\r\n\r\n“Sometimes I joke, sometimes I don’t. Let’s say it’s one of my aims, even if I know it’s practically impossible for me to achieve it. That said, I’ve always maintained that the main thing is the team’s objectives. We’re going to try to win every game we play by sticking together. You have to put personal ambitions to one side.”\r\n\r\nThe team had a blip against Torino. What went wrong?\r\n\r\n“We didn’t put everything the coach had asked of us into practice. We were sure that we were going to go to Torino and win by playing our own game, as we usually do. Something didn’t go quite right and sadly we slipped up. But we’re convinced that we can pick ourselves up.”\r\n\r\nThere have been a few up and downs at the start of the season. What’s the team been lacking so far?\r\n\r\n“We haven’t been able to put a consistent run of results together and there hasn’t been enough desire to show that we’re ready to achieve big things. It’s partly down to us, partly down to bad luck and partly down to those tiny details but we haven’t been able to achieve what we wanted to achieve so far. Having said that, the group is desperate to react and help the team get back to its best.”\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1606:\"<p>On his 40th birthday, Francesco Totti sat down to discuss the milestone - what he has done so far in his remarkable career, and what he still hopes to achieve.</p>\n<p>Read the full transcript from the interview below.</p>\n<p>You scored your 250th Serie A goal against Torino on Sunday. You weren’t joking when you said you wanted to beat Silvio Piola’s record!</p>\n<p>“Sometimes I joke, sometimes I don’t. Let’s say it’s one of my aims, even if I know it’s practically impossible for me to achieve it. That said, I’ve always maintained that the main thing is the team’s objectives. We’re going to try to win every game we play by sticking together. You have to put personal ambitions to one side.”</p>\n<p>The team had a blip against Torino. What went wrong?</p>\n<p>“We didn’t put everything the coach had asked of us into practice. We were sure that we were going to go to Torino and win by playing our own game, as we usually do. Something didn’t go quite right and sadly we slipped up. But we’re convinced that we can pick ourselves up.”</p>\n<p>There have been a few up and downs at the start of the season. What’s the team been lacking so far?</p>\n<p>“We haven’t been able to put a consistent run of results together and there hasn’t been enough desire to show that we’re ready to achieve big things. It’s partly down to us, partly down to bad luck and partly down to those tiny details but we haven’t been able to achieve what we wanted to achieve so far. Having said that, the group is desperate to react and help the team get back to its best.”</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:12:\"field_person\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:3:\"tid\";s:1:\"3\";}}}}',0,1477905171,1),('field:node:3','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:444:\"Bene consectetuer euismod iaceo metuo voco. Macto premo vulpes. Brevitas humo neque premo quidem tamen valde.\n\nAntehabeo loquor suscipit. Letalis ludus ulciscor. Abdo dolor pertineo. Defui enim esca nulla paulatim sit. At elit eros inhibeo iustum pneum si velit. Abbas autem eligo pagus praemitto roto ullamcorper voco vulpes zelus. Facilisis pneum tincidunt usitas. Brevitas gemino jumentum lenis loquor luptatum nisl nobis saepius secundum.\n\n\";s:7:\"summary\";N;s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:456:\"<p>Bene consectetuer euismod iaceo metuo voco. Macto premo vulpes. Brevitas humo neque premo quidem tamen valde.</p>\n<p>Antehabeo loquor suscipit