om a header, while the Pole delivered a simply remarkable stop to deny Stephan El Shaarawy at the death, but in between those moments the visitors often struggled to produce the sort of clear-cut openings that would have delivered the three points.\r\n\r\nAfter a smattering of chances in the opening 80 minutes it was in the final 10 that Luciano Spalletti\'s side really pushed forward, but the Empoli goal seemed to have something of a forcefield around it as headers were cleared off the line, snap-shots were blocked and goal-bound shots palmed away by Skorupski.\r\n\r\nThe result leaves Roma still second in the Serie A standings, albeit now four points behind leaders Juventus.\";s:5:\"#rows\";i:20;s:11:\"#attributes\";a:1:{s:5:\"class\";a:1:{i:0;s:9:\"text-full\";}}s:7:\"#format\";s:13:\"filtered_html\";s:10:\"#base_type\";s:8:\"textarea\";s:7:\"summary\";a:10:{s:5:\"#type\";s:8:\"textarea\";s:14:\"#default_value\";s:0:\"\";s:6:\"#title\";s:7:\"Summary\";s:5:\"#rows\";i:5;s:12:\"#description\";s:61:\"Leave blank to use trimmed value of full text as the summary.\";s:9:\"#attached\";a:1:{s:2:\"js\";a:1:{i:0;s:34:\"modules/field/modules/text/text.js\";}}s:11:\"#attributes\";a:1:{s:5:\"class\";a:1:{i:0;s:12:\"text-summary\";}}s:7:\"#prefix\";s:34:\"<div class=\"text-summary-wrapper\">\";s:7:\"#suffix\";s:6:\"</div>\";s:7:\"#weight\";i:-10;}}s:6:\"#theme\";s:25:\"field_multiple_value_form\";s:11:\"#field_name\";s:4:\"body\";s:12:\"#cardinality\";s:1:\"1\";s:6:\"#title\";s:4:\"Body\";s:9:\"#required\";b:0;s:12:\"#description\";s:0:\"\";s:7:\"#prefix\";s:32:\"<div id=\"body-add-more-wrapper\">\";s:7:\"#suffix\";s:6:\"</div>\";s:10:\"#max_delta\";i:0;s:12:\"#after_build\";a:1:{i:0;s:30:\"field_form_element_after_build\";}s:9:\"#language\";s:3:\"und\";s:14:\"#field_parents\";a:0:{}}s:7:\"#access\";b:1;}s:17:\"field_reviewimage\";a:7:{s:5:\"#type\";s:9:\"container\";s:11:\"#attributes\";a:1:{s:5:\"class\";a:3:{i:0;s:16:\"field-type-image\";i:1;s:28:\"field-name-field-reviewim