tes - but Lukasz Skorupski proved more than equal to the challenge as he repelled everything Roma threw at him, securing a third successive clean sheet for himself and a point for his team.\r\n\r\nEdin Dzeko had Skorupski sprawling early on to make a good save from a header, while the Pole delivered a simply remarkable stop to deny Stephan El Shaarawy at the death, but in between those moments the visitors often struggled to produce the sort of clear-cut openings that would have delivered the three points.\r\n\r\nAfter a smattering of chances in the opening 80 minutes it was in the final 10 that Luciano Spalletti\'s side really pushed forward, but the Empoli goal seemed to have something of a forcefield around it as headers were cleared off the line, snap-shots were blocked and goal-bound shots palmed away by Skorupski.\r\n\r\nThe result leaves Roma still second in the Serie A standings, albeit now four points behind leaders Juventus.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1201:\"<p>Roma were held to a frustrating 0-0 draw at the Stadio Carlo Castellani on Sunday, as a solid rearguard action from Empoli saw them claim a point.</p>\n<p>The Giallorossi\'s best chances of the game came at the very beginning and end of the 90 minutes - but Lukasz Skorupski proved more than equal to the challenge as he repelled everything Roma threw at him, securing a third successive clean sheet for himself and a point for his team.</p>\n<p>Edin Dzeko had Skorupski sprawling early on to make a good save from a header, while the Pole delivered a simply remarkable stop to deny Stephan El Shaarawy at the death, but in between those moments the visitors often struggled to produce the sort of clear-cut openings that would have delivered the three points.</p>\n<p>After a smattering of chances in the opening 80 minutes it was in the final 10 that Luciano Spalletti\'s side really pushed forward, but the Empoli goal seemed to have something of a forcefield around it as headers were cleared off the line, snap-shots were blocked and goal-bound shots palmed away by Skorupski.</p>\n<p>The result leaves Roma still second in the Serie A standings, albeit now four points behind leaders Juventus.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:17:\"field_reviewimage\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:2:\"41\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:25:\"t62kuykrxzhfogrnltcr.jpeg\";s:3:\"uri\";s:34:\"public://t62kuykrxzhfogrnltcr.jpeg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:6:\"289002\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1477903491\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"1918\";s:6:\"height\";s:4:\"1279\";}}}s:14:\"field_category\";a:0:{}s:11:\"rdf_mapping\";a:9:{s:7:\"rdftype\";a:2:{i:0;s:9:\"sioc:Item\";i:1;s:13:\"foaf:Document\";}s:5:\"title\";a:1:{s:10:\"predicates\";a:1:{i:0;s:8:\"dc:title\";}}s:7:\"created\";a:3:{s:10:\"predicates\";a:2:{i:0;s:7:\"dc:date\";i:1;s:10:\"dc:created\";}s:8:\"datatype\";s:12:\"xsd:dateTime\";s:8:\"callback\";s:12:\"date_iso8601\";}s:7:\"changed\";a:3:{s:10:\"predicates\";a:1:{i:0;s:11:\"dc:modified\";}s:8:\"datatype\";s:12:\"xsd:dateTime\";s:8:\"callback\";s:12:\"date_iso8601\";}s:4:\"body\";a:1:{s:10:\"predicates\";a:1:{i:0;s:15:\"content:encoded\";}}s:3:\"uid\";a:2:{s:10:\"predicates\";a:1:{i:0;s:16:\"sioc:has_creator\";}s:4:\"type\";s:3:\"rel\";}s:4:\"name\";a:1:{s:10:\"predicates\";a:1:{i:0;s:9:\"foaf:name\";}}s:13:\"comment_count\";a:2:{s:10:\"predicates\";a:1:{i:0;s:16:\"sioc:num_replies\";}s:8:\"datatype\";s:11:\"xsd:integer\";}s:13:\"last_activity\";a:3:{s:10:\"predicates\";a:1:{i:0;s:23:\"sioc:last_activity_date\";}s:8:\"datatype\";s:12:\"xsd:dateTime\";s:8:\"callback\";s:12:\"date_iso8601\";}}s:3:\"cid\";s:1:\"0\";s:22:\"last_comment_timestamp\";s:10:\"1477903491\";s:17:\"last_comment_name\";N;s:16:\"last_comment_uid\";s:1:\"1\";s:13:\"comment_count\";s:1:\"0\";s:4:\"name\";s:4:\