ything Roma threw at him, securing a third successive clean sheet for himself and a point for his team.\r\n\r\nEdin Dzeko had Skorupski sprawling early on to make a good save from a header, while the Pole delivered a simply remarkable stop to deny Stephan El Shaarawy at the death, but in between those moments the visitors often struggled to produce the sort of clear-cut openings that would have delivered the three points.\r\n\r\nAfter a smattering of chances in the opening 80 minutes it was in the final 10 that Luciano Spalletti\'s side really pushed forward, but the Empoli goal seemed to have something of a forcefield around it as headers were cleared off the line, snap-shots were blocked and goal-bound shots palmed away by Skorupski.\r\n\r\nThe result leaves Roma still second in the Serie A standings, albeit now four points behind leaders Juventus.','','filtered_html'),('node','interview',0,25,25,'und',0,'Luciano Spalletti, the new Giallorossi manager, talks exclusively to asroma.com about what it means to return to the club he loves…\r\n\r\nWelcome back to Roma, Luciano…\r\n\r\n“Thanks. I\'ve never forgotten my time here and Roma has never left my heart.”\r\n\r\nCan you describe how you\'re feeling at the moment?\r\n\r\n“I\'m excited because I know what the merits of this city, this club and this team are. It\'s exciting to work with such worthy people.”\r\n\r\nDid you ever think this opportunity might come around for you again? \r\n\r\n“I\'ve seen things happen in football that I thought would never come to pass. I always had that hope because Rome is a fantastic place to be.”\r\n\r\nThere were lots of rumours about you possibly returning to Roma. When did you start to take them seriously?\r\n\r\n“When I got the phone call from Walter Sabatini.”\r\n\r\nHow did your meeting with James Pallotta go? What did you talk about most?\r\n\r\n“I found him to be a man of exceptional enthusiasm who, despite being physically distant, has the best interests of our team, our city and our club at heart. He clearly has plans for the future and I think that\'s the most important thing to say about our president. People often think that if you live far away, you see something like this as a pastime but Roma really matters to him. That\'s the most important thing.”','','filtered_html'),('node','interview',0,26,26,'und',0,'On his 40th birthday, Francesco Totti sat down to discuss the milestone - what he has done so far in his remarkable career, and what he still hopes to achieve.\r\n\r\nRead the full transcript from the interview below.\r\n\r\nYou scored your 250th Serie A goal against Torino on Sunday. You weren’t joking when you said you wanted to beat Silvio Piola’s record!\r\n\r\n“Sometimes I joke, sometimes I don’t. Let’s say it’s one of my aims, even if I know it’s practically impossible for me to achieve it. That said, I’ve always maintained that the main thing is the team’s objectives. We’re going to try to win every game we play by sticking together. You have to put personal ambitions to one side.”\r\n\r\nThe team had a blip against Torino. What went wrong?\r\n\r\n“We didn’t put everything the coach had asked of us into practice. We were sure that we were going to go to Torino and win by playing our own game, as we usually do. Something didn’t go quite right and sadly we slipped up. But we’re convinced that we can pick ourselves up.”\r\n\r\nThere have been a few up and downs at the start of the season. What’s the team been lacking so far?\r\n\r\n“We haven’t been able to put a consistent run of results together and there hasn’t been enough desire to show that we’re ready to achieve big things. It’s partly down to us, partly down to bad luck and partly down to those tiny details but we haven’t been able to achieve what we wanted to achieve so far. Having said that, the group is desperate to react and help the team get back to its best.”','','filtered_html');
